export default function UsersScreen({ navigation }: RootTabScreenProps<'UsersScreen'>) {
  return(
    <View style={profilePageStyles.container}>
      <Text>ITT LESZNEK A FELHASZNÁLÓK ADATAI</Text>
     
    </View>
  );
}
